import React from 'react';
import Buttons from './buttons';

function Tip() {
    const tips = [5, 10, 15, 25, 50, Custom];
    return (
        <div>
            <span>Select Tip %</span>
            <Buttons 
                name = {tips.map((tip) => {
                    return tip;
                })}
            />
        </div>
    );
}
